import React from 'react';
import { View,
         Text,
         Button,
         Dimension,
         StyleSheet,
         Image } from 'react-native';

const Login = () => {
  return(
    <View style={style.container}>
      <View style={style.header}>
        <Image source={require('../assets/logo2.png')} style={style.logo}>
            </Image>
      </View>
      <View style={style.footer}>
        <Text>Footer</Text>
      </View>
    </View>
    );
};

export default Login;



const style = StyleSheet.create({
  container: {
    flex:1,
    backgroundColor:'#000220'
  },
  header:{
    flex: 2,
    justifyContent: 'center',
    alignItems: 'center',
  },
  footer:{
    flex:1,
    backgroundColor:'#fff',
    borderTopLeftRadius: 30,
    borderTopRightRadius: 30,
    paddingVertical: 50,
    paddingHorizontal: 40
  },
  logoContainer: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo:{
    width: 150,
    height: 56,
  },
})
